export default function SignupSuccess() {
   return (
      <>
         <Container fluid align="center">
            <div style={{ width: '25%', textAlign: 'left' }}>
               <h1>Signup Success</h1>
               <p>You have successfully signed up. You can now sign in.</p>
            </div>
         </Container>
      </>
   );
}
